Resumo do CANALHA do Waldemar:

1- Sai mais caro ao país gastar 100 milhões em novas eleições do que a Petrobras perder 100 BI com resultado fraudado;

2- O STF já legislou tanto, que pode continuar legislando;

3- É mais vergonhoso fazer novas eleições do que sermos uma democracia de fachada.

LIXO!

🇨🇳A última mensagem enviada pelos internautas na zona fabril. A partir de agora, a polícia armada transferida de Luoyang chegou com 20 ônibus e está realizando um contra-ataque contra a área K.

Confrontos na fábrica de iPhone da Foxconn em Zhengzhou, na China. São 200 mil operários confinados pela política da Covid-zero de Xi Jinping, no regime fábrica-dormitório. A burocracia nefasta do PCCh que ordena repressão é o "socialismo" exemplar do PT. 
